import React from 'react';
import './Home.css';

function HomePage() {
  return (
    <div className="home">
      <div className="home-header">
        <h1>Welcome to DevsOnDeck</h1>
        <p>Connecting developers with top opportunities, faster.</p>
      </div>

      {/* Why Us Section */}
      <div className="home-why-us">
        <h2>Why Choose DevsOnDeck?</h2>
        <p>Whether you're a developer looking for the perfect role or an organization searching for top talent, we streamline the connection process.</p>
      </div>

      {/* Call to Action */}
      <div className="home-cta">
        <button className="home-cta-button">Get Started</button>
      </div>
    </div>
  );
}

export default HomePage;
